这款总体来说还是性价比可以的&hellip;&hellip;
产品包装：包装得很好
产品质感：还是比较细腻的
适合肤质：我这种偏黄色肤质的还可以的，比较显白，很适合我&hellip;&hellip;
遮瑕效果：遮瑕感觉一般，不是很明显的还可以遮一下&hellip;&hellip;

